import React, {useState} from "react";
import {Link, Route, Switch} from "react-router-dom";
import './App.css';

function App() {
    return (<>
        <Route exact path="/">
            <ViewComponents />
        </Route>
        <Route path="/examples">
            <ViewExamples />
        </Route>
    </>);
}

export default App;
